package main

import (
	"algorithm/utils/golang"
	"fmt"
)

const (
	grass = 0
	fire  = 1
	wall  = 2

	secondFireOffset = 10
	alwaysSafe       = 1000000000
)

func maximumMinutes(grid [][]int) int {
	rowSz, colSz := len(grid), len(grid[0])

	fireGo(grid)
	start := grid[0][0]
	safeHouse := grid[rowSz-1][colSz-1]
	if start == grass {
		if safeHouse == grass {
			grid[0][0] = fire
			fireGo(grid)
			if grid[rowSz-1][colSz-1] > 0 {
				return alwaysSafe
			} else {
				return -1 // no link
			}
		} else {
			return -1 // no link
		}
	} else {
		if safeHouse == grass {
			return -1 // no link
		} else {
			return byDfs2(grid, point{rowSz - 1, colSz - 1})
		}
	}
}

type point struct {
	i int
	j int
}

func (p point) neighbors(visite func(n point), grid [][]int) {
	f := func(n point) {
		if n.i < 0 || n.i >= len(grid) {
			return
		}
		if n.j < 0 || n.j >= len(grid[0]) {
			return
		}
		if grid[n.i][n.j] == fire || grid[n.i][n.j] == wall {
			return
		}
		visite(n)
	}

	f(point{p.i + 1, p.j})
	f(point{p.i, p.j + 1})
	f(point{p.i - 1, p.j})
	f(point{p.i, p.j - 1})
}

func fireGo(grid [][]int) {
	fires := map[point]struct{}{}
	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[0]); j++ {
			if grid[i][j] == fire {
				fires[point{i, j}] = struct{}{}
			}
		}
	}

	var time = secondFireOffset + 1
	for {
		nextFiles := map[point]struct{}{}

		for fire := range fires {
			fire.neighbors(func(n point) {
				if grid[n.i][n.j] == grass {
					grid[n.i][n.j] = time
					nextFiles[n] = struct{}{}
				}
			}, grid)
		}

		if len(nextFiles) == 0 {
			break
		}
		fires = nextFiles
		time++
	}
}

func byDfs2(grid [][]int, safeHouse point) int {

	var ok *bool
	var waitTime = 0
	var dfs func(track []point, visited map[point]bool)
	dfs = func(track []point, visited map[point]bool) {
		if ok != nil {
			return
		}
		cur := track[len(track)-1]
		nextTime := waitTime + len(track)
		cur.neighbors(func(next point) {
			if !visited[next] {
				if next == safeHouse {
					ok = new(bool)
					*ok = nextTime <= grid[next.i][next.j]-secondFireOffset
					return
				} else {
					if nextTime >= grid[next.i][next.j]-secondFireOffset {
						return
					}
					track = append(track, next)
					visited[next] = true
					dfs(track, visited)
					// visited[next] = false
					track = track[:len(track)-1]
				}
			}
		}, grid)
	}

	var step = (grid[safeHouse.i][safeHouse.j]-secondFireOffset+1)/2 - 1
	if step == 0 {
		step = 1
	}
	var end = grid[safeHouse.i][safeHouse.j] - secondFireOffset + 1
	for waitTime = 0; waitTime < end; waitTime += step {
		ok = nil
		dfs([]point{{0, 0}}, map[point]bool{{0, 0}: true})
		if ok == nil || !*ok {
			if step == 1 || waitTime == 0 {
				return waitTime - 1
			} else {
				waitTime -= step
				step /= 2
			}
		}
	}

	panic("")
}

